  {
    for (i = j; i >= 0; i--)
    {
      if (check[i] == 1)
        return a[i];

    }

  }

  while ((j >= 0) && (k < n))
  {
    if ((check[j] == 1) && (check[k] == 1))
    {
      if (a[j] <= a[k])
        return a[j];
      else
        return a[k];

    }
    else
      if ((check[j] == 1) && (check[k] == 0))
    {
      k++;
    }
    else
      if ((check[j] == 0) && (check[k] == 1))
