int path(const int max, int row, int col, int value)
{
  value += map[row][col];
  if (row >= max)
    return value;

  int leftval = path(max, row + 1, col, value);
  int rightval = path(max, row + 1, col + 1, value);
  return (leftval > rightval) ? (leftval) : (rightval);
}

