    }

  }

  return subT;
}

int max_path(Triangle T)
{
  if (T.n_rows == 1)
  {
    return T.content[0][0];
  }
  else
  {
    Triangle T1 = subTriangle(T, 1, 0);
    Triangle T2 = subTriangle(T, 1, 1);
    return T.content[0][0] + max(max_path(T1), max_path(T2));
  }

}

